import Button from '@mui/material/Button'

export default function KeywordCheck(){
    const styles = {
        border:'1px solid black',
        width:'1510px',
        height:'700px'
      };
      const styles1 = {
        borderBottom:'1px solid black',
        width:'1510px',
        height:'80px',
        display:'flex',
        justifyContent: 'center',
      };

    return(
        <>
            <div style={styles}>
                <div style={styles1}>
                        <div style={{marginTop:'45px',fontWeight:'bold',fontSize:'13px',marginLeft:'650px'}}>검색: </div>
                        <TextField id="outlined-basic" label="검색어를입력하세유" variant="outlined" size="small" style={{marginTop:'30px'}}/>
                        <div style={{marginLeft:'30px',marginTop:'45px',fontWeight:'bold',fontSize:'13px'}}>작업: </div>
                        <FormControlLabel value="female" control={<Radio size="small"/>} label={<Typography style={{fontSize:'13px'}}>등록 & 수정</Typography>} style={{marginTop:'27px',marginLeft:'5px'}} />
                        <FormControlLabel value="female" control={<Radio size="small"/>} label={<Typography style={{fontSize:'13px'}}>등록</Typography>} style={{marginTop:'27px'}} />
                        <FormControlLabel value="female" control={<Radio size="small"/>} label={<Typography style={{fontSize:'13px'}}>수정</Typography>} style={{marginTop:'27px'}} />
                        <FormControlLabel value="female" control={<Radio size="small"/>} label={<Typography style={{fontSize:'13px'}}>삭제</Typography>} style={{marginTop:'27px'}} />
                        <Button variant="outlined" style={{width:'70px',height:'38px',marginTop:'30px'}} color="error">비우기</Button>
                        <Button variant="outlined" style={{width:'90px',height:'38px',marginLeft:'10px',marginTop:'30px'}}>검색하기</Button>
                </div>
            </div>
        </>
    );
}
